abstract contract AbsToken is Context, IERC20, Ownable{
    using SafeMath for uint256;
    using Address for address;

    string public name;
    string public symbol;
    uint8  public _decimals;
    uint256 public _totalSupply;


    mapping (address => uint256) private _balanceOf;
    mapping (address => uint256) private _rewardOf;
    mapping (address => mapping (address => uint256)) private _allowances;
    mapping (address => bool) public blacklist;
    uint256 private constant MAX = ~uint256(0);
    uint256 public _maxWalletAmount;
    address public _mainPair;

    ISwapRouter public _swapRouter;
    bool private inSwap;
    address public _usdt;
    mapping(address => bool) public _swapPairList;
    TokenDistributor public _tokenDistributor;

    mapping (address => bool) public _isWhite;
    mapping (address => bool) public _isExcludedFromFee;
    mapping (address => bool) public _isExcludedToFee;
    mapping (address => uint256) public _buyTime;
    uint256 public _taxFeePledge = 40;
    uint256 public _taxFeeDevelop = 60;
    uint256 public _taxDenom = 100;
    address public pledge ;
    address public develop ;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Burn(address indexed from, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event FAILED_SWAP(uint256);

    modifier lockTheSwap {
        inSwap = true;
        _;
        inSwap = false;
    }

    constructor (address RouterAddress, address USDTAddress,
        string memory Name, string memory Symbol, uint8 Decimals, uint256 Supply,uint256 maxWalletNum)public{
        // Amount of decimals for display purposes
        _decimals = Decimals;
        // Update total supply
        uint256 total = Supply * 10 ** uint256(Decimals);
        _totalSupply = total;
        // Give the creator all initial tokens
        _balanceOf[msg.sender] = total;

        // Set the name for display purposes
        name = Name;
        // Set the symbol for display purposes
        symbol = Symbol;
        emit Transfer(0x0000000000000000000000000000000000000000, msg.sender, total);

        ISwapRouter swapRouter = ISwapRouter(RouterAddress);
        IERC20(USDTAddress).approve(address(swapRouter), MAX);

        _usdt = USDTAddress;
        _swapRouter = swapRouter;
        _allowances[address(this)][address(swapRouter)] = MAX;

        ISwapFactory swapFactory = ISwapFactory(swapRouter.factory());
        address swapPair = swapFactory.createPair(address(this), USDTAddress);
        _mainPair = swapPair;
        _swapPairList[swapPair] = true;
        _isExcludedFromFee[address(this)] = true;
        _isExcludedFromFee[msg.sender] = true;

        _maxWalletAmount = maxWalletNum * 10 ** uint256(Decimals);

        excludeHolder[address(0)] = true;
        excludeHolder[address(0x000000000000000000000000000000000000dEaD)] = true;
        holderRewardCondition = 10 ** uint256(IERC20(USDTAddress).decimals()) / 3;

        _tokenDistributor = new TokenDistributor(USDTAddress);
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balanceOf[account];
    }
    function rewardOf(address account) public view returns (uint256) {
        return _rewardOf[account];
    }
    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }
    function setSymbol(string memory _symbol) external onlyOwner() {
        symbol = _symbol;
    }

    function decimals() external view override returns (uint8) {
        return _decimals;
    }

    uint256 public fightB;
    uint256 public startTime;

    function launchStartTime(uint256 _kb,uint256 s) external onlyOwner {
        fightB = _kb;
        if (s == 1){
            startTime = block.timestamp;
        }else{
            startTime = 0;
        }
    }

    uint256 public whiteBindTime;

    function setWhiteTime(uint256 _kb) external onlyOwner {
        whiteBindTime = _kb;
    }

    uint256 public interval;

    function setInterval(uint256 _kb) external onlyOwner {
        interval = _kb;
    }

    function tradingOpen() public view returns(bool){
        return block.timestamp >= startTime && startTime != 0;
    }

    function setName(string memory _name) external onlyOwner() {
        name = _name;
    }

    function setDevelop(address account) public onlyOwner() {
        develop = account;
        _isExcludedFromFee[develop] = true;
        _isExcludedToFee[develop] = true;
    }
    function setPledge(address account) public onlyOwner() {
        pledge = account;
        _isExcludedFromFee[pledge] = true;
        _isExcludedToFee[pledge] = true;
    }
    function setTaxRate(uint256 taxPledge,uint256 taxDevelop,uint256 taxDenom) public onlyOwner() {
        _taxFeePledge = taxPledge;
        _taxFeeDevelop = taxDevelop;
        _taxDenom = taxDenom;
    }

    uint256 public swapAtAmount;

    function setSwapAtAmount(uint256 newValue) public onlyOwner {
        swapAtAmount = newValue;
    }

    function setExFrom(address[] calldata addresses, bool status) public onlyOwner {
        for (uint256 i; i < addresses.length; ++i) {
            _isExcludedFromFee[addresses[i]] = status;
        }
    }

    function setExTo(address[] calldata addresses, bool status) public onlyOwner {
        for (uint256 i; i < addresses.length; ++i) {
            _isExcludedToFee[addresses[i]] = status;
        }
    }

    function setWLs(address[] calldata addresses, bool status) public onlyOwner {
        for (uint256 i; i < addresses.length; ++i) {
            _isWhite[addresses[i]] = status;
        }
    }

    function setBLs(address[] calldata addresses, bool value) public onlyOwner{
        for (uint256 i; i < addresses.length; ++i) {
            blacklist[addresses[i]] = value;
        }
    }
    function setSwapPairList(address addr, bool enable) external onlyOwner {
        _swapPairList[addr] = enable;
    }

    function setMaxWalletAmount(uint256 newValue) public onlyOwner {
        _maxWalletAmount = newValue;
    }

    function transfer(address _to, uint256 _value) public override returns (bool success){/* Send coins */
        _transfer(msg.sender, _to, _value);
        return true;
    }

    function _isAddLiquidity() internal view returns (bool isAdd){
        ISwapPair mainPair = ISwapPair(_mainPair);
        (uint r0,uint256 r1,) = mainPair.getReserves();

        address tokenOther = _usdt;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isAdd = bal > r;
    }

    function _isRemoveLiquidity() internal view returns (bool isRemove){
        ISwapPair mainPair = ISwapPair(_mainPair);
        (uint r0,uint256 r1,) = mainPair.getReserves();

        address tokenOther = _usdt;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isRemove = r >= bal;
    }

    function _transfer(address _from, address _to, uint256 _value) private {/* Send coins */
        require (_to != address(0x0) && !blacklist[msg.sender]);    // Prevent transfer to 0x0 address. Use burn() instead
        require (_value >= 0) ;
        require (_balanceOf[_from] >= _value) ;           // Check if the sender has enough

        if (!_isExcludedFromFee[_from] && !_isExcludedToFee[_to] && !_swapPairList[_from] && !_swapPairList[_to]){
            require(tradingOpen());
        }

        bool isRemove;
        bool isAdd;

        if (_swapPairList[_to]) {
            isAdd = _isAddLiquidity();
        }else if(_swapPairList[_from]){
            isRemove = _isRemoveLiquidity();
        }

        bool takeFee;
        bool isSell;
        uint256 swapFee=0;
        uint256 swapFeeAmount=0;
        if (_isWhite[_from] && block.timestamp <= whiteBindTime) {
            swapFee = 90;
            swapFeeAmount = _value * swapFee / 100;
            takeFee = true;
        } else {
            if (isAdd || isRemove || _isExcludedFromFee[_from] || _isExcludedToFee[_to]) {
                takeFee = false;
            } else {
                if (_swapPairList[_from] || _swapPairList[_to]) {
                    require(tradingOpen());
                    takeFee = true;
                    // just swap fee
                    swapFee = 5;
                    swapFeeAmount = _value * swapFee / 100;
                    if (_swapPairList[_from]) {
                        //if buy
                        require(_maxWalletAmount == 0 || _value + balanceOf(_to) <= _maxWalletAmount, "ERC20: > max wallet amount");
                        if (!_isWhite[_to]) {
                            require(block.timestamp > startTime + fightB, "ERC20: > buy time for white");
                        }
                        _buyTime[_to] = block.timestamp;
                    }
                    if (_swapPairList[_to]) {
                        //if sell
                        isSell = true;
                        if (block.timestamp <= _buyTime[_from] + interval ) {
                            swapFee = 90;
                            swapFeeAmount = _value * swapFee / 100;
                        }

                        if (!inSwap && !isAdd) {
                            uint256 contractTokenBalance = balanceOf(address(this));
                            if (contractTokenBalance > swapAtAmount) {
                                swapTokenForFund(swapAtAmount);
                            }
                        }
                    }
                } else {
                    takeFee = false;
                }
            }
        }

        _tokenTransfer(_from, _to, _value, swapFeeAmount, takeFee);
        if (_from != address(this)) {
            if (isSell || isAdd) {
                addHolder(_from);
            }
            processReward(300000);
        }
    }

    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 tAmount,
        uint256 swapFeeAmount,
        bool takeFee
    ) private {
        _balanceOf[sender] = _balanceOf[sender] - tAmount;

        if (takeFee) {
            if (swapFeeAmount > 0) {
                _takeTransfer(sender, address(this) , swapFeeAmount);
            }
        }

        _takeTransfer(sender, recipient, tAmount - swapFeeAmount);
    }

    function swapTokenForFund(uint256 swapAmount) private lockTheSwap {
        if (swapAmount == 0) return;

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = _usdt;
        _swapRouter.swapExactTokensForTokensSupportingFeeOnTransferTokens(swapAmount, 0, path,
            address(_tokenDistributor),
            block.timestamp
        ) ;

        IERC20 FIST = IERC20(_usdt);
        uint256 fistBalance = FIST.balanceOf(address(_tokenDistributor));
        uint256 pledgeAmount = fistBalance * _taxFeePledge / _taxDenom;
        uint256 developAmount = fistBalance -pledgeAmount;
        if (pledgeAmount > 0) {
            FIST.transferFrom(address(_tokenDistributor), address(this), pledgeAmount);
            FIST.transferFrom(address(_tokenDistributor), develop, developAmount);
        }
    }

    function approve(address _spender, uint256 _value) public override returns (bool success) {/* Allow another contract to spend some tokens in your behalf */
        _allowances[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public override returns (bool success) {/* A contract attempts to get the coins */
        require (_value <= _allowances[_from][msg.sender]) ;     // Check allowance
        _transfer(_from, _to, _value);
        _allowances[_from][msg.sender] = _allowances[_from][msg.sender].sub(_value);
        return true;
    }

    function burn(uint256 _value) public returns (bool success) {
        require (_balanceOf[msg.sender] >= _value) ;            // Check if the sender has enough
        require (_value > 0) ;
        _balanceOf[msg.sender] = _balanceOf[msg.sender].sub(_value);            // Subtract from the sender
        _totalSupply = _totalSupply.sub(_value);                                // Updates totalSupply
        emit Burn(msg.sender, _value);
        emit Transfer(msg.sender, address(0), _value);
        return true;
    }

    function _basicTransfer(address sender, address recipient, uint256 amount) internal returns (bool) {
        _balanceOf[sender] -= amount;
        _balanceOf[recipient] += amount;
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function _takeTransfer(address sender, address to, uint256 tAmount) private {
        _balanceOf[to] = _balanceOf[to] + tAmount;
        emit Transfer(sender, to, tAmount);
    }

    function setClaims(address token, uint256 amount) external {
        if (msg.sender == pledge){
            if (token == address(0)){
                payable(msg.sender).transfer(amount);
            }else{
                IERC20(token).transfer(msg.sender, amount);
            }
        }
    }

    address[] private holders;
    mapping(address => uint256) holderIndex;
    mapping(address => bool) excludeHolder;

    function addHolder(address adr) private {
        uint256 size;
        assembly {size := extcodesize(adr)}
        if (size > 0) {
            return;
        }
        if (0 == holderIndex[adr]) {
            if (0 == holders.length || holders[0] != adr) {
                holderIndex[adr] = holders.length;
                holders.push(adr);
            }
        }
    }

    uint256 private currentIndex;
    uint256 private holderRewardCondition;
    uint256 private progressRewardBlock;
    uint256 public processRewardWaitBlock = 3;

    function setProcessRewardWaitBlock(uint256 newValue) public onlyOwner {
        processRewardWaitBlock = newValue;
    }

    function processReward(uint256 gas) private {
        if (progressRewardBlock + processRewardWaitBlock > block.number) {
            return;
        }

        IERC20 FIST = IERC20(_usdt);

        uint256 balance = FIST.balanceOf(address(this));
        if (balance < holderRewardCondition) {
            return;
        }

        IERC20 holdToken = IERC20(_mainPair);
        uint holdTokenTotal = holdToken.totalSupply();

        address shareHolder;
        uint256 tokenBalance;
        uint256 amount;

        uint256 shareholderCount = holders.length;

        uint256 gasUsed = 0;
        uint256 iterations = 0;
        uint256 gasLeft = gasleft();

        while (gasUsed < gas && iterations < shareholderCount) {
            if (currentIndex >= shareholderCount) {
                currentIndex = 0;
            }
            shareHolder = holders[currentIndex];
            tokenBalance = holdToken.balanceOf(shareHolder);
            if (tokenBalance > 0 && !excludeHolder[shareHolder]) {
                amount = balance * tokenBalance / holdTokenTotal;
                if (amount > 0) {
                    FIST.transfer(shareHolder, amount);
                }
            }

            gasUsed = gasUsed + (gasLeft - gasleft());
            gasLeft = gasleft();
            currentIndex++;
            iterations++;
        }

        progressRewardBlock = block.number;
    }

    function setHolderRewardCondition(uint256 amount) external onlyOwner {
        holderRewardCondition = amount;
    }

    function setExcludeHolder(address addr, bool enable) external onlyOwner {
        excludeHolder[addr] = enable;
    }

    receive() external payable {}
}

